  <title>Star Diagram</title>
  <style>
    /* Встраиваем все стили CSS */

    /* Сброс стилей */
    body, html {
      margin: 0;
      padding: 0;
      font-family: 'Roboto', sans-serif;
      overflow: hidden;
    }

    /* Веб-шрифт Roboto */
    @import url('https://fonts.googleapis.com/css2?family=Roboto:wght@400;500;700&display=swap');

    /* Основной контейнер */
    .star {
      position: relative;
      width: 2380px;
      height: 3368px;
      overflow: hidden;
    }

    /* Заголовок */
    .header_font {
      position: absolute;
      width: 962px;
      height: 200px;
      left: 700px;
      top: -3260px;
      color: #E6DFD2;
      font-size: 120px;
      font-weight: 600;
      line-height: 140px;
      text-align: left;
    }

    /* Главный контейнер */
    .main {
      position: relative;
      width: 100%;
      height: 100%;
    }

    /* Общие стили для чисел */
    .main span {
      position: absolute;
      font-family: 'Roboto', sans-serif;
      text-align: center;
    }

    /* Основные числа */
    .personality,
    .spirituality,
    .money,
    .relationship,
    .health {
      font-size: 140px;
      font-weight: 700;
      line-height: 164px;
      color: #E6DFD2;
      opacity: 0.98;
    }

    /* Ошибки */
    .pat_male_line_err,
    .mat_male_line_err,
    .pat_female_line_err,
    .doom_err,
    .mat_female_line_err {
      font-size: 100px;
      font-weight: 500;
      line-height: 117px;
      color: #271915;
    }

    /* Миссия */
    .mission {
      font-size: 160px;
      font-weight: 600;
      line-height: 188px;
      color: #FF693A;
    }

    /* Нижние элементы */
    .foot_personality,
    .foot_spirituality,
    .foot_money,
    .foot_relationship,
    .foot_health {
      font-size: 180px;
      font-weight: 400;
      line-height: 211px;
      color: #E3DDD0;
    }

    /* Указываем веб-шрифты для Roboto */
    @font-face {
      font-family: 'Roboto';
      src: url('https://fonts.gstatic.com/s/roboto/v30/KFOlCnqEu92Fr1MmEU9fBBc4.woff2') format('woff2');
      font-weight: 400;
      font-style: normal;
    }

    @font-face {
      font-family: 'Roboto';
      src: url('https://fonts.gstatic.com/s/roboto/v30/KFOlCnqEu92Fr1MmEU9fBBc4.woff2') format('woff2');
      font-weight: 700;
      font-style: normal;
    }

    /* Позиционирование элементов */
    .personality { left: 352px; top: -2028px; }
